  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  },[])

  const editArr = (num) => {
    axios.post("/members", {
      members: 'test'
    })
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }
  return (
    <div>
      {(typeof data.members === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i ) => (

          <button key={i} onClick={() => editArr()}>{member}</button>

        ))
      )}
    </div>
  )
}

export default App
